#!/bin/bash

#變數設定
s3bucket="mohohanapnortheast1"

#安裝s3cmd
cd ~
echo "" > /tmp/s3cmd-1.0.1.tar.gz.txt
echo "[[YOUR_SPECIFIC_CONFIGURE_IN_BASE64]]" > /tmp/.s3cfg.txt
base64 -d < /tmp/s3cmd-1.0.1.tar.gz.txt > /tmp/s3cmd-1.0.1.tar.gz
base64 -d < /tmp/.s3cfg.txt             > /tmp/.s3cfg
cd /opt
sudo cp /tmp/s3cmd-1.0.1.tar.gz ./
sudo tar -zxf ./s3cmd-1.0.1.tar.gz
cd s3cmd-1.0.1/
sudo python setup.py install
cd ..
sudo rm s3cmd-1.0.1.tar.gz
cp /tmp/.s3cfg /home/hadoop
rm /tmp/s3cmd-1.0.1.tar.gz
rm /tmp/s3cmd-1.0.1.tar.gz.txt
rm /tmp/.s3cfg
rm /tmp/.s3cfg.txt

#安裝慣用的shell環境
cd ~
mkdir shell
s3cmd get -r s3://${s3bucket}/shell/ ./shell/
cp    ./shell/.bashrc.hadoop ./.bashrc
cp    ./shell/.screenrc      ./
cp    ./shell/.vimrc         ./
cp -R ./shell/.vim           ./
sudo cp    ./shell/.bashrc.root   /root/.bashrc
sudo cp    ./shell/.screenrc      /root/
sudo cp    ./shell/.vimrc         /root/
sudo cp -R ./shell/.vim           /root/
rm -rf ./shell/

#安裝相依軟體(要兩次因為可能會有libmp3lame等2個軟體需要重裝)
cd ~
mkdir deb
s3cmd get -r s3://${s3bucket}/deb/ ./deb/
cd deb
sudo dpkg -i *.deb
sudo dpkg -i *.deb
cd ..
sudo rm -rf ./deb/

#準備好mapper腳本
cd ~
s3cmd get -r s3://${s3bucket}/steps/ffmapper.sh ./ffmapper.sh
chmod 755 ./ffmapper.sh

#準備好progress腳本
cd ~
s3cmd get -r s3://${s3bucket}/steps/ffprogress.sh ./ffprogress.sh
chmod 755 ./ffprogress.sh
